- input: "TEXT\x1CC00060707\x1C1\x1C\x1CF3XA\x1C\"The report is being amended to disclose
    additional unitemized receipts totaling $8268.00.  In transitioning our FEC report
    preparation to a vendor, these receipts were inadvertently not included on the
    original report.  During an audit to confirm that all data was included in each
    period since the transition, we discovered our oversight.  All receipts are raised
    from individuals giving $200 or less during the year, and thus do not require
    itemization; however, it is always our intention to timely disclose all transactions
    on the original report. The total figure disclosed on Line 11a(ii) now reflects
    the correct total as will all future reports.  Other than the corresponding adjustments
    to the ending balance and other appropriate figures on the Summary and Detailed
    Summary Pages, there are no other changes to the report.  Please update your records
    accordingly.\"\n"
